import React from "react";

const Card = ({ title, description, imageSrc }) => {
  return (
    <div className="card">
      {imageSrc && <img src={imageSrc} alt={title} />}
      <div className="card-body">
        <h2>{title}</h2>
        <p>{description}</p>
      </div>
    </div>
  );
};

export default ProductCard;
